import type { EditorProps } from '@toast-ui/react-editor';
import { Editor } from '@toast-ui/react-editor';
import { createRef, useEffect, useState } from 'react';
import { useMedia } from 'react-use';
import styles from "./index.module.css"
import { motion } from "framer-motion"
import { Loading } from '../Loading';
import { useSnapshot } from 'valtio';
import { app } from '../../../states/app';


interface IEditor extends EditorProps {
  initialValue?: string;
  onChange?: (value: string | undefined) => void;
  height?: string;
}

export const MarkdownEditor: React.FC<IEditor> = (props) => {

  const isDark = useMedia('(prefers-color-scheme: dark)');
  const [render, setRender] = useState(true);
  const ref = createRef<Editor>();
  const appSnapshot = useSnapshot(app)

  useEffect(() => {
    setRender(false);
    if (!appSnapshot.editorDarkCSSLoaded && isDark) {
      return;
    }
    setTimeout(() => {
      setRender(true);
    }, 1000);
  }, [isDark, appSnapshot])

  return (
    <div className={styles.editor}>
      <Loading loading={!render} />
      {
        render && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1, }}
          >
            <Editor
              initialValue={props.initialValue || " "}
              ref={ref}
              height={props.height}
              initialEditType={'markdown'}
              previewStyle={'vertical'}
              theme={isDark ? 'dark' : 'default'}
              useCommandShortcut={true}
              onChange={() => {
                props.onChange?.(ref.current?.getInstance().getMarkdown());
              }}
            />
          </motion.div>
        )
      }
      <style>
        {`
          @media only screen and (-webkit-min-device-pixel-ratio: 2), only screen and (min-device-pixel-ratio: 2), only screen and (min-resolution: 192dpi), only screen and (min-resolution: 2dppx) {
            .toastui-editor-toolbar-icons, .toastui-editor-context-menu span::before {
              background: url(data:image/png;base64,) no-repeat;
              background-size: 466px 146px;
            }
          }
          .toastui-editor-toolbar-icons {
            background-position-y: 3px;
          } 
        `}
      </style>
    </div>
  )
}